<pre><code>{
  &quot;_id&quot;: ObjectId(&quot;5b28cab902f28e18b863bd01&quot;),
  &quot;name&quot;: &quot;Liverpool&quot;,
  ...
  &quot;players&quot;: [
    ObjectId('5b23tmb902f28e18b863bd01'),
    ObjectId('5b23tmb902f28e18b863bd02'),
    ObjectId('5b23tmb902f28e18b863bd03'),
    ...
  ]
  ...
},
...
</code></pre>
<p><strong>Players Collection:</strong></p>
<pre><code>{
  &quot;_id&quot;: ObjectId(&quot;5b2b9a8bbda339352cc39ec1&quot;),
  &quot;name&quot;: &quot;Mohamed Salah&quot;,
  &quot;nationality&quot;: [
    ObjectId(&quot;5b23cn1902f28e18b863bd01&quot;),
    ObjectId(&quot;5b23cn2902f28e18b863bd02&quot;),
  ],
  ...
},
...
</code></pre>
<p><strong>Countries</strong> <strong>Collection:</strong></p>
<pre><code>{
  &quot;_id&quot;: ObjectId(&quot;5b23cn1902f28e18b863bd01&quot;),
  &quot;name&quot;: &quot;England&quot;,
  ...
},
{
  &quot;_id&quot;: ObjectId(&quot;5b23cn2902f28e18b863bd02&quot;),
  &quot;name&quot;: &quot;Egypt&quot;,
  ...
},
...
</code></pre>
<p>How to get a result, which is below, using MongoDB aggregation (<code>$lookup</code>, <code>$pipeline</code>, etc):</p>
<pre><code>{
  &quot;divisions&quot;: [
    {
      &quot;_id&quot;: ObjectId(&quot;5b28cab902f28e18b863bd36&quot;),
      &quot;name&quot;: &quot;Premier League&quot;,
      ...
      &quot;teams&quot;: [
        {
          &quot;_id&quot;: ObjectId(&quot;5b28cab902f28e18b863bd01&quot;),
          &quot;name&quot;: &quot;Liverpool&quot;,
          ...
          &quot;players&quot;: [
            {
              &quot;_id&quot;: ObjectId(&quot;5b23tmb902f28e18b863bd01&quot;),
              &quot;name&quot;: &quot;Mohamed Salah&quot;,
              &quot;nationality&quot;: [
                {
                  &quot;_id&quot;: ObjectId(&quot;5b23cn2902f28e18b863bd02&quot;),
                  &quot;name&quot;: &quot;Egypt&quot;,
                  ...
                },
                {
                  &quot;_id&quot;: ObjectId(&quot;5b23cn1902f28e18b863bd01&quot;),
                  &quot;name&quot;: &quot;England&quot;,
                  ...
                }
              ]
              ...
            },
            ...
          ]
        },
        ...
      ]
    },
    {
      &quot;_id&quot;: ObjectId(&quot;5b28cab902f28e18b863bd37&quot;),
      &quot;name&quot;: &quot;Championship&quot;,
      ...
    },
    ...
  ]
}
</code></pre>
<p>I manage to make a first-level merge:</p>
<pre><code>db.divisions.aggregate([
  {
    $lookup: {
      from: 'teams',
      localField: 'teams',
      foreignField: '_id',
      as: 'teams'
    }
  },
])
</code></pre>
<p>and then I ran into difficulties, so I would be very grateful if someone could help me with this issue.</p>

