Aggregate results based on different fields in MongoDB<p>I am trying to get the count of location wise data and budget wise data in a single query for all owners from the same collection. In future we may need to show reports based on project wise as well.
Below is the sample collection.</p>
<pre><code>[
  {
    &quot;owner&quot;: 1,
    &quot;location&quot;: &quot;Goa&quot;,
    &quot;budget&quot;: &quot;1 Cr and Above&quot;,
    &quot;project&quot;: &quot;ABC&quot;
  },
