    &quot;$group&quot;: {
      &quot;_id&quot;: {
        &quot;owner&quot;: &quot;$owner&quot;,
        &quot;location&quot;: &quot;$location&quot;,
        &quot;budget&quot;: &quot;$budget&quot;
