  },
  {
    &quot;$group&quot;: {
      &quot;_id&quot;: &quot;$_id.owner&quot;,
      &quot;location&quot;: {
        &quot;$push&quot;: {
          &quot;location&quot;: &quot;$_id.location&quot;,
